import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-experience',
  templateUrl: './experience.component.html',
  styleUrls: ['./experience.component.scss']
})
export class ExperienceComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<div class="container">
  <div class="page">
    <div class="text">
      <div>
        <h2>Experiences</h2>
      </div>
    </div>
    <div class="col">
      <h3>UMYNO</h3>
      <p>
        Developed a tool for cleaning of IMDb's data and prediction of rating for upcoming movies based on the attributes like actor’s rating, director’s rating, genre using machine learning techniques such as Decision tree, K means Clustering and Neural Networks.
      </p>
    </div>
  </div>
</div>
